import React from 'react';
import Link from 'next/link';

// COMPONENTS
import Header from '../components/Common/Header';
import Button from '../components/Common/Button';

const IndexPage = () => {
    return (
        <>
            <Header />
            <Button primary>
                <Link href="/posts/new">
                    <a>Write post</a>
                </Link>
            </Button>
            <Button>More</Button>
        </>
    );
};

export default IndexPage;
